import React from 'react';
import "../card.css";
import useFetch from './useFetch';




export default function Card() {
  const [data] = useFetch("../data.json");
  return (
   
     data && data.map((item) => {
     return (
        
 <div className="container" >
      <div className='card card1'>
        <img src={item.logo} alt="img" />
        <div className='descript-left'>
          <div className="descript-cabecalho">
                <span>{item.company}</span> <span>{item.new}</span> <span>{item.featured}</span>
          </div>

          <div className="title">
            <h4>{item.position}</h4>
          </div>

          <div className='descript-footer'>
            <span>{ item.postedAt + " - "}</span> <span>{item.contract + " - "}</span> <span>{item.location }</span>
          </div>

        </div>

        <div className='descript-right'>
          <span>{item.role}</span>  <span>{item.level}</span>  <span>{item.languages}</span>
        </div>

      </div >

    </div>
      )
  })
  );
}
